import React from 'react';
import ReactDOM from 'react-dom';

import * as kuchbhi from './App';

function add(number1, number2){
  return number1 + number2;

}

ReactDOM.render(
  <>
    <ul>
      <li>{kuchbhi.default}</li>
      <li>{kuchbhi.lname}</li>
      <li>{kuchbhi.mname}</li>
    </ul>
  </>,
  document.getElementById('root')
)
